import PageAPI from './Components2/PageAPI';
import PageForm from'./Components2/PageForm';
import PageIncrement from'./Components2/PageIncrement';
export default function App() {
  return (
      <BrowserRouter>
       <ul>
      <li>
      <Link to='/PageAPI'>Comp1</Link>
      <Link to='/PageForm'>Comp1</Link>
      <Link to='/PageIncrement'>Comp1</Link>
      </li>
     </ul>

     <Routes>
          <Route  path='/PageAPI' element={<PageAPI/>} />
          <Route  path='/PageForm' element={<PageForm/>} />
          <Route  path='/PageIncrement' element={<PageForm/>} />
    </Routes>

      </BrowserRouter>
  )
}
